import StarBorderIcon from '@mui/icons-material/StarBorder';

const ResponsePagination = (props) => {

    return (
        <Container >
            <ListGroup as="ul">
            {props.data.map((el) => (
                    <li key={el.id}>
                        {" "}
                        <ListGroup.Item {...el} removeItem={props.removeItem} as="li" action href="#link1" className='d-flex justify-content-between'><div>Cras justo odio</div> <div><StarBorderIcon /></div></ListGroup.Item>
                    </li>
                ))}
                <ListGroup.Item as="li" action href="#link1" className='d-flex justify-content-between'><div>Cras justo odio</div> <div><StarBorderIcon /></div></ListGroup.Item>
                <ListGroup.Item as="li" action href="#link2" className='d-flex justify-content-between'> <div>Dapibus ac facilisis in</div> <div><StarBorderIcon /></div> </ListGroup.Item>
                <ListGroup.Item as="li" action href="#link3" className='d-flex justify-content-between'><div> Morbi leo risus</div> <div><StarBorderIcon /></div></ListGroup.Item>
                <ListGroup.Item as="li" action href="#link4" className='d-flex justify-content-between'><div> Morbi leo risus</div> <div><StarBorderIcon /></div></ListGroup.Item></ListGroup>
        </Container>

    );
};

export default ResponsePagination;
